def determine_date_format(S: str) -> str:
    """"""
    if len(S) != 4:
        return 'NA'
    (head, tail) = (S[:2], S[2:])
    head_is_month = 1 <= int(head) <= 12
    tail_is_month = 1 <= int(tail) <= 12
    if head_is_month and tail_is_month:
        return 'AMBIGUOUS'
    elif head_is_month:
        return 'MMYY'
    elif tail_is_month:
        return 'YYMM'
    else:
        return 'NA'
